window.onload=function(){document.querySelector("body").addEventListener("click",function(event){if(event.target.tagName!=="A"||event.target.getElementById("spotifyModal"))
return;if(history===null)
return;var newUrl=event.target.href;var domain=window.location.origin;if(typeof domain!=="string"||newUrl.search(domain)!==0){event.preventDefault();window.open(newUrl,"_blank");}else{event.preventDefault();loadPage(newUrl);history.pushState(null,"",newUrl);}});}
window.onpopstate=function(event){loadPage(window.location);}
function loadPage(newUrl){var httpRequest=new XMLHttpRequest();httpRequest.onreadystatechange=function(){if(httpRequest.readyState!==XMLHttpRequest.DONE)
return;var newDocument=httpRequest.responseXML;if(newDocument===null)
return;var newContent=httpRequest.responseXML.getElementById("mainContent");if(newContent===null)
return;document.title=newDocument.title;var contentElement=document.getElementById("mainContent");contentElement.replaceWith(newContent);}
httpRequest.responseType="document";httpRequest.open("GET",newUrl);httpRequest.send();};